webpackJsonp([70229111794952],{427:function(A,e){A.exports={data:{markdownRemark:{id:"/Users/Robert/uncharted/src/pages/activities/snowshoe-hiking.md absPath of file >>> MarkdownRemark",html:'<h1>Adventure skiing and Snowboarding</h1>\n<p>I’m ready for you in every season of the year, just so you know. Skiing/ Snowboarding is one of my winter themed activities and I can guarantee you will have a blast! </p>\n<p>Arena Platos Paltinis was designed in the beginning as an outset for sports and a health complex, which has been primarily oriented towards families. Now, the Ski School is one of the best in Romania, having well-trained staff and motivated participates who later on, will show off their skills. </p>\n<p>Furthermore, the resort has the most modern fun-park in Romania, with nightlights dedicated to three different skiing levels: beginner, intermediate and advanced. </p>\n<p>Lastly, every weekend, Arena Platos Paltinis gathers competitions for professionals, wacky games like “Slide and Freeze” or “Miss Bikini” contests. The audience of these events and the adrenaline that they provide, have made them become legendary within the Carpathian Mountains. </p>\n<p>If a skiing/ snowboarding session is not enough for you, simply just go for the other options too, and remember that you can mix and match your adventure pack, tailoring it for your own personal preferences, abilities and desires! </p>\n<p><img src="/img/3c79bd940c.jpg" alt="null"></p>\n<h1>Snowshoe Hiking</h1>\n<p>I am ready for you in every season of the year, just so you know. Snow Shoes Hiking is one of my winter themed activities and I can guarantee you will have a blast!</p>\n<p>It is the perfect wither activity for those hiking lovers that wish to be surrounded by snow this time, and create their own trails with a little bit of mystery involved. Snowshoe hiking is the way to go if you find yourself a creative person, ready to discover new paths covered in snow. </p>\n<p>The interesting part of this activity is that there is no learning curve. You know how to walk, therefore you know how to walk in snowshoes too!</p>\n<p><img src="/img/dsc_0172.jpg" alt="null"></p>',frontmatter:{image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.6441523118766999,src:"/static/dsc_1067-6895b9d0a28f0d6737381df4e923367a-75c44.jpg",srcSet:"/static/dsc_1067-6895b9d0a28f0d6737381df4e923367a-d1f5d.jpg 250w,\n/static/dsc_1067-6895b9d0a28f0d6737381df4e923367a-6d1fa.jpg 500w,\n/static/dsc_1067-6895b9d0a28f0d6737381df4e923367a-75c44.jpg 1000w,\n/static/dsc_1067-6895b9d0a28f0d6737381df4e923367a-89ded.jpg 1500w,\n/static/dsc_1067-6895b9d0a28f0d6737381df4e923367a-c7352.jpg 2000w,\n/static/dsc_1067-6895b9d0a28f0d6737381df4e923367a-2cbf8.jpg 3000w,\n/static/dsc_1067-6895b9d0a28f0d6737381df4e923367a-e7904.jpg 3627w",sizes:"(max-width: 1000px) 100vw, 1000px"}}},title:"Winter Adventure",tagline:"Snowboarding, Skiing & Snowshoe Hiking "}}},pathContext:{id:"/Users/Robert/uncharted/src/pages/activities/snowshoe-hiking.md absPath of file >>> MarkdownRemark"}}}});
